import React from 'react';
import ReactDOM from 'react-dom';

const App=()=>(
  <div>
    <p>Hello World</p>
  </div>
)


ReactDOM.render( 
    <App />
  ,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
